import React from "react";


const Weather =()=>{
      return(
        <>
          <div className="container">
               <div className="weather">
                    <div className="search">
                          <input type="text" placeholder="Enter City Name"/>
                          <button>Search</button>
                    </div>
               </div>

          </div>
        </>
      );
};

export default Weather;
